;; gorilla-repl.fileformat = 1

;; **
;;; # Modifying only part of a picture
;;; 
;;; This recipe shows how to use *submat* to create a region of interest, or commonly called ROI, that is only part of the main picture. 
;;; 
;;; A submat shares the same underlying pixels as the original picture, thus any mofication on the submat will also modify the original picture.
;;; 
;;; So why would you want to use a submat then ? 
;;; The main reason is that it is easier to work with. 
;; **

;; @@
(ns homeless-crater
  (:require
    [opencv4.core :refer :all]
    [opencv4.colors.rgb :as rgb]
    [opencv4.utils :as u]
[opencv4.gorilla :as g]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## blur only part of the picture
;; **

;; @@
(def rose
  (-> 
    "resources/matching/rose_flower.jpg" 
    imread 
    (u/resize-by 0.25)))

(def rose-1 
  (-> rose clone))
(def sub 
  (submat rose-1 (new-rect 50 25 150 150)))
(median-blur! sub 9)

(g/>> rose-1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"213\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x68d0e48c \"BufferedImage@68d0e48c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 213 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def sub2 
  (submat (-> rose clone) (new-rect 100 100 50 50)))

(g/>> sub2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"50\" height=\"50\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x29ddb684 \"BufferedImage@29ddb684: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 50 height = 50 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## turn picture to grey except part
;; **

;; @@

(def rose-2 (-> rose clone))

(def gray
   (-> 
     rose 
     clone 
     (cvt-color! COLOR_BGR2GRAY) 
     (cvt-color! COLOR_GRAY2BGR)))

(def rects [
  (new-rect 50 50 100 150)
  (new-rect 200 100 100 100)])

(doseq [ r rects ]
  (let [ s (submat rose-2 r ) mask (new-mat)]
    (copy-to s (submat gray r) mask)))

(g/>> gray)

